                        if (data == null) {
                            $(`#them_thongbao_ma`).text("""");
                            $(""#btnThemModal"").attr('disabled', false);
                        }
                        else {
                            $(""#btnThemModal"").attr('disabled', true);
                            $(`#them_thongbao_ma`).text(""Mã đã tồn tại"");
         ");
