                        }

                    },


                    error: function (data) {
                        alert(""Error: "" + data);
                    }
                });
            }
            $(""#item_them_ma"").change(function () {
                var ma = document.getElementById(""item_them_ma"").value;
               
                checkma(ma);
            });
        </script>
